import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';
import {ajaxPut} from '../../Services/Http/Ajax';
import * as constants from '../../Utils/Constants'
import * as urls from '../../Utils/Urls'
import NameFormComponent from './NameFormComponent';
import AddressFormComponent from './AddressFormComponent';
import ZipFormComponent from './ZipFormComponent';
import ContactNumberFormComponent from './ContactNumberFormComponent';
import MemberCountFormComponent from './MemberCountFormComponent';
import DobFormComponent from './DobFormComponent';
import HousingTypeFormComponent from './HousingTypeFormComponent';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import {confirm, showMessage} from '../../Utils/Util';
import {STATUS_ACTIVE} from '../../Utils/Constants';
import {ajaxGet} from '../../Services/Http/Ajax';
import {ToastContainer} from 'react-toastify';


const UpdateFamilyContainer = (props) => {

    const [familyArray, setFamilyArray] = React.useState([]);
    const [childFamilyData, setChildFamilyData] = React.useState([]);
    let familyData = [];
    let familyDetails;


    React.useEffect(() => {
        let familyId = props.location.state.familyId;
        let uri = urls.API_URL.GET_FAMILY_UPDATE_DATA + '/' + familyId;
        let familyData;
        ajaxGet(uri, (response) => {
            if (response.status === constants.STATUS_ACTIVE) {
                familyData = response.content;
                setFamilyArray(familyData);
            }
        });
    }, []);

    const stateChangeInName = (data) => {
        setChildFamilyData(data);
        // this.setState( childFamilyData);
    };

    const handleSubmit = () => {
        let familyId = props.location.state.familyId;
        let uri = urls.API_URL.PUT_FAMILY_UPDATE + '/' + familyId;

        let familyDetails = {
            nameData: familyData.nameData ? familyData.nameData.nameData : '',
            addressData: familyData.addressData ? familyData.addressData.addressData : '',
            memberCountData: familyData.memberCountData ? familyData.memberCountData.memberCountData : '',
            dobData: familyData.dobData ? familyData.dobData.dobData : '',
            zipData: familyData.zipData ? familyData.zipData.zipData : '',
            contactData: familyData.contactData ? familyData.contactData.contactData : '',
            housingData: familyData.housingData ? familyData.housingData.housingData : ''
        };

        if(familyDetails) {
            ajaxPut(uri, familyDetails, (response) => {
                if (response.status === STATUS_ACTIVE) {
                }
            });

        } else {
            showMessage('error', 'Something went wrong');
        }
    };


    const handleSubmitConfirm = (e) => {
        e.preventDefault();
        let title = 'Are you sure you want to proceed?';
        confirm(title, handleSubmit);
    };

    const buildFamilyData = (childFamilyData) => {
        let dataKey = Object.keys(childFamilyData)[0];
        familyData[dataKey] = childFamilyData;
    };


    return (

        <div>
            <MenuComponent/>
            <Jumbotron fluid>
                <Container>
                    <h1>Edit Family</h1>
                </Container>
            </Jumbotron>
            <form onSubmit={handleSubmitConfirm}>
                <Form.Group controlId="exam$memberDataformedpleForm.ControlInput1">
                    <div className="container">
                        <NameFormComponent famData={familyArray} onSelectedChild = {buildFamilyData}/>
                    </div>
                    <div className="container">
                        <AddressFormComponent famData={familyArray} onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <HousingTypeFormComponent famData={familyArray}  onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <ZipFormComponent famData={familyArray} onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <ContactNumberFormComponent famData={familyArray}  onSelectedChild = {buildFamilyData} />
                    </div>
                    <div className="container">
                        <DobFormComponent  famData={familyArray} onSelectedChild = {buildFamilyData} />
                    </div>
                    <Jumbotron fluid>
                        <Container>
                            <Button  type="submit" variant="primary" >Submit</Button>
                        </Container>
                    </Jumbotron>
                </Form.Group>
            </form>
            <FooterComponent/>
        </div>
    )
};

export default UpdateFamilyContainer;
